import Card from "./Card";
import image1 from "../Assets/1.jpg";
import image2 from "../Assets/2.jpg";
import CardsData from "./CardsData"

const lastUpdateData = [
    {
        id: 1,
        image: image1,
        primaryText: "Project Poplloon:",
        secundaryText: "Lorem ipsum"
    },

    {
        id: 2,
        image: image2,
        primaryText: "Mira Softworks Website:", 
        secundaryText: "Lorem ipsum"
    },

    {
        id: 3,
        image: image2,
        primaryText: "Mira Softworks Website:",
        secundaryText: "Lorem ipsum"
    },
]

const lineCardsData = [
    {
        id: 1,
        title: "Lorem"
    }, [
        {
            card: 1
        }
    ]
]


export function LineCards({title}) {

    title = lineCardsData.title

    return <div className="container d-flex justify-content-center align-items-center h-100 mt-5">
    <div className="row">
        <h1 className="mb-5">- {title} -</h1>
        {
            lastUpdateData.map(lastUpdateDataSet => (
                <div className="col-md-4" key={lineCardsData}>
                   
                </div>
            ))
        }
    </div>
</div>
}

export function LastUpdate({title}) {
    return <div className="container d-flex justify-content-center align-items-center h-100 mt-5">
        <div className="row">
            <h1 className="mb-5">- {title} -</h1>
            {
                lastUpdateData.map(lastUpdateDataSet => (
                    <div className="col-md-4" key={lineCardsData}>
                        <Card image={lastUpdateDataSet.image} primaryText={lastUpdateDataSet.primaryText} secundaryText={lastUpdateDataSet.secundaryText} />
                    </div>
                ))
            }
        </div>
    </div>
}
